    true,nt"url": null,nt"notes": "The SSA National Instant Criminal Background
    Check Database (PNICS)  captures information on clients that have been identified
    as legally incompetent adults or disabled adults, diagnosed with certain mental
    disabilities, receiving Title II/XVI payments due to certain mental impairments
    and have been paid benefits through a representative payee. The information is shared
    with the FBI. It is added to the FBI database to identify these individuals that
    are prohibited from purchasing , owning or transferring firearms and ammunition.",nt"license_title":
